import './App.css';
import { Link } from 'react-router-dom';

function App() {
	return (
		<div className="App">
			<h1>App</h1>
			<nav
				style={{
					borderBottom: 'solid 1px',
					paddingBottom: '1rem',
				}}
			>
				<Link to="/Home">Home</Link> {' '}|{' '}
				<Link to="/Products">Products</Link>{' '}|{' '}
				<Link to="/Contact">Products</Link>
			</nav>
		</div>
	);
}

export default App;
